import React, {Component} from 'react';

import Greet from './components/Greet';


class App extends Component{

	render(){

  return(

     <div className="App">
      <Greet name="Aditya" sirname="Mishra">
      <p></p>
      </Greet>
      <Greet name="Sagar"  sirname="Kumar"></Greet>
      <Greet name="Sonam"  sirname="sharma"></Greet>
     </div>

  	  );
  }
}


export default App;
